import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Link, Switch } from 'react-router-dom';


const Profile = ({formData}) => (
  <div>
    <h2>Profile Page</h2>
    <p>First Name: {formData.firstName}</p>
    <p>Last Name: {formData.lastName}</p>
    <p>Email: {formData.email}</p>
    <p>Favorite Season: {formData.season}</p>
    <Link to="/dashboard">Go to Dashboard</Link>
  </div>
);

const Dashboard = () => (
  <div>
    <h2>Dashboard</h2>
    <p>Cream cheese pepper jack cheese slices. Lancashire blue castello fromage fromage pecorino cheeseburger red leicester everyone loves. Caerphilly danish fontina cheese triangles cheese and biscuits croque monsieur paneer halloumi cheese and biscuits. Cheese on toast queso stilton cheeseburger.</p>
  </div>
);

const App = () => {
  // Form state
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    email: '',
    password: '',
    season: ''
  });
  // Error state
  const [error, setError] = useState('');

  const validateForm = () => {
    const { firstName, lastName, email, password, season } = formData;
    const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
    const passwordRegex = /^(?=.*[a-z])(?=.*[A-Z])(?=.*\d)(?=.*[@$!%*?&])[A-Za-z\d@$!%*?&]{8,}$/;

    if (!firstName.match(/^[A-Za-z]+$/)) {
      return 'First Name should only contain alphabets.';
    }
    if (!lastName.match(/^[A-Za-z]+$/)) {
      return 'Last Name should only contain alphabets.';
    }
    if (!emailRegex.test(email)) {
      return 'Please enter a valid email address.';
    }
    if (!passwordRegex.test(password)) {
      return 'Password must contain at least one uppercase letter, one lowercase letter, one number, and one special character.';
    }
    if (!season) {
      return 'Please select your favorite season.';
    }

    return '';
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const validationError = validateForm();
    if (validationError) {
      setError(validationError);
      return;
    }
    setError('');
    // Normally here you would send data to the server
    console.log(formData);
  };

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  return (
    <Router>
      <Switch>
        <Route path="/" exact>
          <form onSubmit={handleSubmit}>
            <div>
              <label>First Name:</label>
              <input type="text" name="firstName" value={formData.firstName} onChange={handleChange} />
            </div>
            <div>
              <label>Last Name:</label>
              <input type="text" name="lastName" value={formData.lastName} onChange={handleChange} />
            </div>
            <div>
              <label>Email:</label>
              <input type="email" name="email" value={formData.email} onChange={handleChange} />
            </div>
            <div>
              <label>Password:</label>
              <input type="password" name="password" value={formData.password} onChange={handleChange} />
            </div>
            <div>
              <label>Favorite Season:</label>
              <select name="season" value={formData.season} onChange={handleChange}>
                <option value="">Select a season</option>
                <option value="Spring">Spring</option>
                <option value="Fall">Fall</option>
                <option value="Winter">Winter</option>
              </select>
            </div>
            <button type="submit">Submit</button>
          </form>
          {error && <div style={{ color: 'red' }}>{error}</div>}
        </Route>
        <Route path="/profile" render={() => <Profile formData={formData} />} />
        <Route path="/dashboard" component={Dashboard} />
      </Switch>
    </Router>
  );
};

export default App;
